import React from "react";

const Input = ({  heading, ...props }) => {
  return (
    <>
      <label htmlFor="inputBox" className="text-[14px] pb-[8px]">{heading}</label>

      <input
        {...props}
        id="inputBox"
        className="max-w-[560px] w-full border bg-[#F9FAFB] border-[#D1D5DB] focus:outline-none py-[16px] teext-[#4B5563] px-[24px] text-[14px] leading-[21px]"
      />
    </>
  );
};

export default Input;
